--
-- Name: unsubscribes_by_periods(json, timestamp without time zone, timestamp without time zone, bigint[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.unsubscribes_by_periods(hasura_session json, start_date timestamp without time zone, end_date timestamp without time zone, tg_channel_ids bigint[]) RETURNS SETOF public.fn_unsubscribes_by_periods
    LANGUAGE plpgsql STABLE
    AS $$
DECLARE
  x_hasura_user_id uuid;
BEGIN
  x_hasura_user_id := hasura_session ->> 'x-hasura-user-id';
  PERFORM
    public.check_user_access(x_hasura_user_id, tg_channel_ids);
  RETURN QUERY WITH intervals AS (
    SELECT
      '0_TO_1_MIN' AS interval_label,
      0 AS interval_start,
      60 AS interval_end
    UNION ALL
    SELECT
      '1_MIN_TO_1_HOUR',
      60,
      3600
    UNION ALL
    SELECT
      '1_HOUR_TO_1_DAY',
      3600,
      86400
    UNION ALL
    SELECT
      '1_DAY_TO_3_DAYS',
      86400,
      259200
    UNION ALL
    SELECT
      '3_DAYS_TO_7_DAYS',
      259200,
      604800
    UNION ALL
    SELECT
      '1_WEEK_TO_2_WEEKS',
      604800,
      1209600
    UNION ALL
    SELECT
      '2_WEEKS_TO_1_MONTH',
      1209600,
      2592000
    UNION ALL
    SELECT
      '1_MONTH_TO_2_MONTHS',
      2592000,
      5184000
)
  SELECT
    i.interval_label,
    COUNT(su.tg_user_id)::integer AS count,
    ROUND((COUNT(su.tg_user_id) * 100.0 / NULLIF(SUM(COUNT(su.tg_user_id)) OVER (), 0)), 2)::double precision AS percentage
  FROM
    intervals i
  LEFT JOIN stat_user su ON EXTRACT(EPOCH FROM (su.left_at - su.joined_at)) BETWEEN i.interval_start AND i.interval_end
    AND su.tg_channel_id = ANY (tg_channel_ids)
    AND su.left_at >= start_date
    AND su.left_at <= end_date
GROUP BY
  i.interval_label,
  i.interval_start
ORDER BY
  count DESC;
END;
$$;


