--
-- Name: user_signups_by_period(json, timestamp without time zone, timestamp without time zone, bigint[], text, text[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.user_signups_by_period(hasura_session json, start_date timestamp without time zone, end_date timestamp without time zone, tg_channel_ids bigint[], time_period text, tg_invite_links text[] DEFAULT NULL::text[]) RETURNS SETOF public.fn_users_by_period
    LANGUAGE plpgsql STABLE
    AS $$
DECLARE
  x_hasura_user_id uuid;
BEGIN
  x_hasura_user_id := hasura_session ->> 'x-hasura-user-id';
  PERFORM
    public.check_user_access(x_hasura_user_id, tg_channel_ids);
  RETURN QUERY
  SELECT
    DATE_TRUNC(
      CASE WHEN time_period = 'hour' THEN
        'hour'
      WHEN time_period = 'day' THEN
        'day'
      WHEN time_period = 'month' THEN
        'month'
      ELSE
        'hour' -- default to 'hour' if an invalid value is provided
      END, joined_at)::timestamp(6) WITHOUT time zone AS time_bucket,
    COUNT(*) AS signup_count
  FROM
    stat_user
  WHERE
    tg_channel_id = ANY (tg_channel_ids)
    AND joined_at IS NOT NULL
    AND joined_at BETWEEN start_date AND end_date
    AND (tg_invite_links IS NULL
      OR invite_link = ANY (tg_invite_links))
  GROUP BY
    time_bucket
  ORDER BY
    time_bucket;
END;
$$;


